import React from 'react'
import Button from './Button'

const PageSelector = () => {

const onGetTable = () => {console.log('Fetch my table!')};
const onRandomTable = () => {console.log('Get random table!')};

    return (
        <div>
            <input type='text' placeholder='Wikipedia article URL'/>

            <Button color='green' text='Get table' onClick={onGetTable}/>
            <Button text='Random table' onClick={onRandomTable}/>
        </div>
    )
}

export default PageSelector
